import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Container from "react-bootstrap/Container";
import Button from "react-bootstrap/Button";
import { Navbar } from "react-bootstrap";
import Col from "react-bootstrap/Col";
import Menu from 'react-icons/lib/md/menu';
import Row from "react-bootstrap/Row";

import coffee from './img/icons-09.png';
import location from './img/icons-10.png';
import people from './img/icons-11.png';
import art from './img/icons-12.png';
import order from './img/icons-14.png';

class Bottom extends React.Component {
	constructor(props) {
        super(props);

        this.state = {
            open: false,
        };
    }

    render() {

        const footerStyle = {
          backgroundColor: "purple",
          fontSize: "20px",
          color: "white",
          borderTop: "1px solid #E7E7E7",
          padding: "5px",
          position: "fixed",
          left: "0",
          bottom: "0",
          height: "60px",
          width: "100%",
          display: "inline",
        };

        const phantomStyle = {
          display: "block",
          padding: "5px",
          height: "60px",
          width: "100%"
        };

      return (
      	<Container>
	        <div style={phantomStyle} />
            <Row style={footerStyle}>
                <Col xs={2}><img width="45" src={coffee} alt="stats" className="pad_side"/></Col>Å¾
                <Col xs={1}></Col>
                <Col xs={2}><img width="45" src={location} alt="map" /></Col>
                <Col xs={2}><img width="45" src={order} alt="order" /></Col>
                <Col xs={2}><img width="45" src={people} alt="reward" /></Col>
                <Col xs={1}></Col>
                <Col xs={2}><img width="45" src={art} alt="create" /></Col>
            </Row>
        </Container>

      );
    }
}

export default Bottom;
